import React,{useState} from "react";
import {Formik, Form, Field, ErrorMessage} from 'formik'
import * as Yup from 'yup'
import axios  from "axios";

function Register (){

    const [error, setError] = useState("");

    const initialValues = {
        BankName:"",
        password:"",
        openingTimings:"",
        closingTimings:"",
        contactNo_1:"",
        contactNo_2:"",
        plotno:"",
        block:"",
        street:"",
        area:"",
        city:"",
        manager_fname:"",
        manager_lname:""


    }
    const validationSchema = Yup.object().shape({

        BankName: Yup.string().min(3).max(30).required('The blood bank name is required'),
        password: Yup.string().min(10).required('The password is required'),
        openingTimings : Yup.string().required('The opening timing is required'),
        closingTimings: Yup.string().required('The closing timing is required'),
        contactNo_1 : Yup.string().required('the numbers must be exactly 11 digits').matches(/^[0-9]+$/, "Must be only digits").min(11).max(11),
        contactNo_2 : Yup.string().required('the numbers must be exactly 11 digits').matches(/^[0-9]+$/, "Must be only digits").min(11).max(11),
        plotno: Yup.string().required('The plot number is required'),
        block: Yup.string().required('The block is required'),
        street: Yup.string().required('The street is required'),
        area: Yup.string().required('The area is required'),
        city: Yup.string().required('The city is required'),
        manager_fname: Yup.string().required('The manager first name is required'),
        manager_lname: Yup.string().required('The manager last name is required'),

        
    });
    const onSubmit = async (data)=>{
        let response
        // let success = false;
        try{
         response = await axios.post("http://localhost:3001/api/authBank/Register", data)
        console.log("try wala"+ response.data.error);
        }catch(err){
            console.log("err wala" + err);
            setError(err)
            console.log("catch wala"+ response.data.error);
        }
        
        
        // setError(response.data.error);
        console.log(error);
        
    }
    // if(error){
    //     return (
    //         <div>error</div>
    //     )
    // }
    if(error){

    
    return ( 
    
        
         
            
    
    <div classsName="createPostPage">
        <div id="error">The bank name already exists</div>
    <div className="header">Blood Bank Registration Form</div>
    <Formik initialValues={initialValues} onSubmit={onSubmit} validationSchema={validationSchema}>
    
    <Form className="formContainer">
    
    <label>Bank Name:</label>
    <ErrorMessage name="BankName" component="span"/>
    <Field autocomplete = "off" id="inputCreatePost" name="BankName" placeholder="eg: Agha Khan"/>
    
    <label>Password:</label>
    <ErrorMessage name="password" component="span"/>
    <Field autocomplete = "off" id="inputCreatePost" name="password" placeholder="eg: @!#@aman "/>

    <label>Opening Timings:</label>
    <ErrorMessage name="openingTimings" component="span"/>
    <Field autocomplete = "off" id="inputCreatePost" name="openingTimings" placeholder="eg: 8:00:00am "/>


    <label>Closing Timings:</label>
    <ErrorMessage name="closingTimings"  component="span"/>
    <Field autocomplete = "off" id="inputCreatePost" className="post" name="closingTimings" placeholder="eg: 12:00:00pm "/>

    <label>Contact No 1:</label>
    <ErrorMessage name="contactNo_1" component="span"/>
    <Field autocomplete = "off" id="inputCreatePost" name="contactNo_1" placeholder="eg: 03123231231 "/>

    <label>Contact No2:</label>
    <ErrorMessage name="contactNo_2" component="span"/>
    <Field autocomplete = "off" id="inputCreatePost"  name="contactNo_2" placeholder="eg: 03111222333"/>

    <label>Plot:</label>
    <ErrorMessage name="plotno" component="span"/>
    <Field autocomplete = "off" id="inputCreatePost"  name="plotno" placeholder="eg: A-7/D "/>

    <label>Block:</label>
    <ErrorMessage name="block" component="span"/>
    <Field autocomplete = "off" id="inputCreatePost"  name="block" placeholder="eg: 13 "/>

    <label>Street:</label>
    <ErrorMessage name="street" component="span"/>
    <Field autocomplete = "off" id="inputCreatePost"  name="street" placeholder="eg: street is required "/>

    <label>Area:</label>
    <ErrorMessage name="area" component="span"/>
    <Field autocomplete = "off" id="inputCreatePost"  name="area" placeholder="eg: Gulshan e Iqbal "/>

    <label>City:</label>
    <ErrorMessage name="city" component="span"/>
    <Field autocomplete = "off" id="inputCreatePost"  name="city" placeholder="eg: Karachi "/>

    <label>Manager First Name:</label>
    <ErrorMessage name="manager_fname" component="span"/>
    <Field autocomplete = "off" id="inputCreatePost"  name="manager_fname" placeholder="eg: faraz "/>

    <label>Manager Last Name:</label>
    <ErrorMessage name="manager_lname" component="span"/>
    <Field autocomplete = "off" id="inputCreatePost" classname="post" name="manager_lname" placeholder="eg: ali "/>


    <button type="submit">Register</button>




    </Form>

    </Formik>
    
    </div>
    
    
    )
    }
}

export default Register;
